import React, {Component} from 'react'



class IssueList extends Component {

    constructor(props){
        super(props);

        this.state = {
            issuedata:[],
        };
    }

    componentDidMount(){
        fetch('http://localhost:8080/issues')
        .then(response => response.json())
        .then((data) => {
            this.setState({issuedata:data})
        })
        .catch(console.log)
        
        
    }

    
    render(){
        const highPriority = <div className="fa fa-exclamation-circle"></div>
        return(
           
            <div className="issueList">                
                {this.state.issuedata.map((issue) => (
                    <div className="card text-center">
                        <div className="card-body">
                            {issue.issueId}
                            <h6>{issue.issueTitle}</h6>
                            {
                              issue.priority == "high" ? {highPriority}: null
                            }
                        </div>
                    </div>
                ))}                 
            </div>
          
        )
    }
}

export default IssueList;
